import React from 'react';

export default function About() {
  return (
    <div>
      <h1>About</h1>
      <p>
        Steven Kim Chung is currently a student of the UW Full Stack Coding Bootcamp.
        He's a curious learn-it-all making a dive into software engineering witha strong
        interest in Security. He was born and raised in Seattle. Steven received his
        Bachelor's of Science in Applied Physics from the University of Washington.
        After that, he went on to work at local Seattle startups, PitchBook and Highspot.
      </p>
    </div>
  );
}
